import React from 'react';
import { useState } from 'react';
import { makeStyles } from '@material-ui/core';
import AppBarComponent from './AppBarComponent';
import Grid from '@material-ui/core/Grid';
import Paper from '@material-ui/core/Paper';
import Typography from '@material-ui/core/Typography';
import Card from '@material-ui/core/Card';
import CardHeader from '@material-ui/core/CardHeader';
import CardMedia from '@material-ui/core/CardMedia';
import CardActions from '@material-ui/core/CardActions';
import Button from '@material-ui/core/Button';
import IconButton from '@material-ui/core/IconButton';
import AccessTimeIcon  from '@material-ui/icons/AccessTime';
import TextField from '@material-ui/core/TextField';
const myStyles = makeStyles((theme)=>
{
    return {
        "mainContainer" : 
        {
            "margin" : theme.spacing(2)
        },
        "appBarSpacer" : theme.mixins.toolbar,
        "content" : 
        {
            "color" : "#2929aa"
        },
        "headerContainer" : 
        {
            "backgroundColor" : "#2929aa",
            "padding" : theme.spacing(5),
            "color" : "white"
        },
        "courses" : 
        {
            "marginTop" : theme.spacing(5) 
        },
        "card" : 
        {
            "padding" : theme.spacing(2),
            "width" : "450px"
        },
        "cardContent" : 
        {
            "padding" : theme.spacing(2)
        },
        "formPaper" : 
        {
            "padding" : theme.spacing(5)
        }
    };
});
const HomeComponent = (props)=>
{
    const classes = myStyles();
    const [recipes,setRecipes] = React.useState([]);
    const [searchedFor,setSearchedFor] = React.useState("");
    return (
        <div className = {classes.mainContainer}>
            <AppBarComponent tabIndex = {props.tabIndex} changeTab = {props.changeTab} />
            <div className = {classes.content}>
                <Grid container spacing = {12}>    
                    <Grid item className = {classes.courses}>
                        <Paper className = {classes.formPaper}>
                            <Grid item>
                                <TextField variant = 'outlined' value = {searchedFor} onChange = {(ev)=>{setSearchedFor(ev.target.value);}} label = "Search Recipe"></TextField>
                            </Grid>
                            {searchedFor}
                            <Typography><h3>Recipes</h3></Typography>

                        </Paper>
                    </Grid>
                </Grid>
            </div>
        </div>
    );
}
export default HomeComponent;
